import React, { Component } from 'react';
import './style.scss';

// Component import
import Header from './Components/Header';
import Search from './Components/Search';

class Git extends Component {
  render() {
    return (
      <div className="main">
        <Header />
         <Search />
      </div>
    );
  }
}

export default Git;
